import React from 'react';
import './Contact.css';

const Contact: React.FC = () => {
  return (
    <div style={{ height: '100vh', paddingTop: '60px' }}>
      <h1>Contact</h1>
      <p>Contact section content.</p>
    </div>
  );
}

export default Contact;
